import React from 'react';
import { Link } from 'react-router-dom';

const Home = () => {
  return (
    <div className="container text-center mt-5">
      <h1 className="mb-4">Welcome to the Homepage</h1>
      <div className="row justify-content-center">
        <div className="col-12 col-md-5 mb-3">
          <Link to="/book">
            <button className="btn btn-primary btn-block btn-lg w-100">Go to Book Page</button>
          </Link>
        </div>
        <div className="col-12 col-md-5 mb-3">
          <Link to="/user">
            <button className="btn btn-success btn-block btn-lg w-100">Go to User Page</button>
          </Link>
        </div>
      </div>
    </div>
  );
};

export default Home;
